    | otherwise -> TokenFloatLit value
    where value = read str :: Float

integerLiteral :: String -> Token
integerLiteral str = if
    | value > fromIntegral (maxBound :: Int32) -> ErrorOverflow str
    | otherwise -> TokenIntLit . fromIntegral $ value
